import React,{Component} from 'react';
import TopNavLeftIcons from './TopNavLeftIcons';


class TopNavLeft extends Component {
     
    render() {
        return (
            <div>
                <TopNavLeftIcons media ='facebook'/>
                <TopNavLeftIcons media ='google'/>
                <TopNavLeftIcons media ='twitter'/>
                <TopNavLeftIcons media ='linkedin'/>
                <TopNavLeftIcons media ='instagram'/>
            </div>
        )
    };
}
export default TopNavLeft;
